// GetMartialArtsData returns the loaded martial arts data.
func GetMartialArtsData() *MartialArtsChummer {
	return martialArtsData
}

// GetAllMartialArts returns all martial arts.
func GetAllMartialArts() []MartialArt {
	if len(martialArtsData.MartialArts) == 0 {
		return []MartialArt{}
	}
	return martialArtsData.MartialArts[0].MartialArt
}

// GetMartialArtByID returns the martial art with the given ID, or nil if not found.
func GetMartialArtByID(id string) *MartialArt {
	arts := GetAllMartialArts()
	for i := range arts {
		if arts[i].ID == id {
			return &arts[i]
		}
	}
	return nil
}

// GetAllTechniques returns all standalone techniques.
func GetAllTechniques() []TechniqueItem {
	if len(martialArtsData.Techniques) == 0 {
		return []TechniqueItem{}
	}
	return martialArtsData.Techniques[0].Technique
}

// GetTechniqueByID returns the technique with the given ID, or nil if not found.
func GetTechniqueByID(id string) *TechniqueItem {
	techniques := GetAllTechniques()
	for i := range techniques {
		if techniques[i].ID == id {
			return &techniques[i]
		}
	}
	return nil
}
